import React, { useState, useReducer } from "react";
import MetaTags from "react-meta-tags";  
import BootstrapTable from "react-bootstrap-table-next"
import axios from 'axios';  
//Import Breadcrumb
import Breadcrumbs from "../../components/Common/Breadcrumb";
import {
  Row,
  Col,
  Card,
  CardBody,
  FormGroup,
  Button,
  CardTitle,
  CardSubtitle,
  Label,
  Input,
  Container,
  FormFeedback,
  Form,
} from "reactstrap";

const products = [
  { id: 1, age: 25, qty: 1500, cost: 1000 },
  { id: 2, age: 34, qty: 1900, cost: 1300 },
  { id: 3, age: 67, qty: 1300, cost: 1300 },
  { id: 4, age: 23, qty: 1100, cost: 6400 },
  { id: 5, age: 78, qty: 1400, cost: 4000 },
]

const columns = [
  {
    dataField: "id",
    text: "ID",
  },
  {
    dataField: "age",
    text: "Age(AutoFill)",
  },
  {
    dataField: "qty",
    text: "Qty(AutoFill and Editable)",
  },
  {
    dataField: "cost",
    text: "Cost(Editable)",
  },
]


const DonwloadData = () => {
  axios({
    method: "post",
    url: "http://localhost:9002/app/app001/get-all",
    data: {},
    headers: { "Content-Type": "application/json" },
  })
    .then(function (response) {
      //handle success
      if(response.data.messaeg = 1){
        alert('success Upload Data');
        rangeValidation.setValues({"max_L_kdUser":"","max_L_nmUser":"", max_L_poc : 'POC AHM'});
        document.getElementById("idFileUpload").value = "";
      }
      
    })
    .catch(function (response) {
      //handle error
      console.log(response);
    });
  return (
    <React.Fragment>
      <div className="page-content">
        <MetaTags>
          <title>
            Form Validation | Skote - React Admin & Dashboard Template
          </title>
        </MetaTags>
        <Container fluid={true}>
          <Breadcrumbs title="Forms" breadcrumbItem="Download foto dengan marking" />
          <Row>
            <Col>
              <Card>
                <CardBody>
                  <CardTitle>Datatable Editable </CardTitle>

                  <div className="table-responsive">
                    <BootstrapTable
                      keyField="id"
                      data={products}
                      columns={columns}
                    />
                  </div>
                </CardBody>
              </Card>
            </Col>
          </Row>
        </Container>
      </div>
    </React.Fragment>
  );
};
  
export default DonwloadData
